import './App.css';
import Home from './pages/home';
import Canvas from './pages/canvas';
import {BrowserRouter as Router,Routes,Route,Navigate,} from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<Home />}/>
      </Routes>
    </Router>
  );
}

export default App;
